import NavigationBar from "./components/NavigationBar";
import {
  BrowserRouter,
  Route,
  Routes}
  from 'react-router-dom';


function App() {
  return (
    <>
      <BrowserRouter>
        <div id="app-holder">
          <NavigationBar />
          <div className="container">
            <Routes>
              <Route exact path="/" element={<Home />}/>

            </Routes>
          </div>
        </div>
      </BrowserRouter>
    </>
  );
}

export default App;
